%[text] ## Import Data
thisFilePath = matlab.desktop.editor.getActiveFilename;
[thisFolder, ~, ~] = fileparts(thisFilePath);

rootFolder = fileparts(thisFolder);

powerDataPath = fullfile(rootFolder, 'data', 'ErcotPowerDemand.csv');
windDataPath = fullfile(rootFolder, 'data', 'interpolated_data.csv');


windOpts = detectImportOptions(windDataPath);
powerOpts = detectImportOptions(powerDataPath);
windData = readtable(windDataPath, windOpts);
powerData = readtable(powerDataPath, powerOpts);




turbinesByCase =  [ 37.1505*1.0; % case 1    Primary reliance on wind
                    37.1505*0.9; % case 2
                    37.1505*0.8; % case 3
                    37.1505*0.7; % case 4
                    37.1505*0.6; % case 5
                    37.1505*0.5; % case 6
                    37.1505*0.4; % case 7 
                    37.1505*0.3; % case 8
                    37.1505*0.2; % case 9
                    37.1505*0.1; % case 10
                    37.1505*0.0; % case 11    Primary reliance on H2
                    ];

numTurbines = turbinesByCase(3) %[control:slider:7c7f]{"position":[30,31]} %[output:07989705]

windTimestamp                       = windData.TIMESTAMP;
hoursFromZero                       = windData.HOURS_FROM_ZERO;
% interval                          = windData.INTERVAL;
windSpeed                           = windData.WIND_SPEED;
windSpeedAtHeight                   = windData.WIND_SPEED_AT_HEIGHT;
windSpeedRounded                    = windData.WIND_SPEED_ROUNDED;  
powerGenerated_kW                   = windData.POWER_OUTPUT_kW * numTurbines;
% energyGeneratedInterval_kWh       = windData.ENERGY_GENERATED_INTERVAL_kWh;
energyGeneratedTotal_kWh            = windData.TOTAL_ENERGY_kWh * numTurbines;
        
        
powerTimestamp                      = powerData.TIMESTAMP;
powerConsumed_mW                    = powerData.SCENT;
powerConsumedUnreduced_kW           = powerConsumed_mW * 1000; % convert from MW to kW and then reduce load by a factor of 1000 to make numbers more digestible 
energyConsumedIntervalUnreduced_kWh = powerConsumedUnreduced_kW * 1;
energyConsumedTotalUnreduced_kWh    = powerData.SCENT_TOTAL_ENERGY_MWh * 1000;
powerConsumed_kW                    = powerConsumedUnreduced_kW * 1/1000;
energyConsumedInterval_kWh          = powerConsumedUnreduced_kW * 1/1000;
energyConsumedTotal_kWh             = energyConsumedTotalUnreduced_kWh * 1/1000;




windDates  = datetime(windTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
powerDates = datetime(powerTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
%%
%[text] ## Wind Speed Graph
figure; %[output:5e889742]
hold on %[output:5e889742]
plot(windDates, windSpeedAtHeight) %[output:5e889742]
xlabel("date") %[output:5e889742]
ylabel("wind speed (m/s)") %[output:5e889742]
title("Speed at time"); %[output:5e889742]
hold off %[output:5e889742]
%%
%[text] ## Wind Power Graph
figure; %[output:5bcd1ba1]
hold on %[output:5bcd1ba1]
plot(windDates, powerGenerated_kW) %[output:5bcd1ba1]
xlabel("date") %[output:5bcd1ba1]
ylabel("power produced (kW)") %[output:5bcd1ba1]
title("Instantaneous Power Produced"); %[output:5bcd1ba1]
hold off %[output:5bcd1ba1]
%%
%[text] ## Wind Total Energy Graph
figure; %[output:2f336543]
hold on %[output:2f336543]
plot(windDates, energyGeneratedTotal_kWh) %[output:2f336543]
xlabel("date") %[output:2f336543]
ylabel("total energy produced (kWh)") %[output:2f336543]
title("Total Energy Generated During 2025"); %[output:2f336543]
hold off %[output:2f336543]
%%
%[text] ## Consumption Power Graph
figure; %[output:1651e691]
hold on %[output:1651e691]
plot(powerDates, powerConsumed_kW) %[output:1651e691]
xlabel("date") %[output:1651e691]
ylabel("power consumed (kW)") %[output:1651e691]
title("Instantatenous Power Consumed"); %[output:1651e691]
hold off %[output:1651e691]
%%
%[text] ## Consumption Energy Graph
figure; %[output:72a6fade]
hold on %[output:72a6fade]
plot(powerDates, energyConsumedTotal_kWh) %[output:72a6fade]
xlabel("date") %[output:72a6fade]
ylabel("total energy consumed (kWh)") %[output:72a6fade]
title("Total Energy Consumed During 2025"); %[output:72a6fade]
hold off %[output:72a6fade]
%%
%[text] ## Surplus/Difecit Power
surplusPower = powerGenerated_kW - powerConsumed_kW;
figure; %[output:640262fb]
hold on %[output:640262fb]
plot(powerDates, surplusPower) %[output:640262fb]
yline(0, 'color', "white") %[output:640262fb]
xlabel("date") %[output:640262fb]
ylabel("instantaneous surplus power (kWh)") %[output:640262fb]
title("Surplus/Deficit Power for 2025"); %[output:640262fb]
hold off %[output:640262fb]
%%
%[text] ## Surplus/Deficit Energy
surplusEnergy = energyGeneratedTotal_kWh - energyConsumedTotal_kWh;
figure; %[output:839ceb8d]
hold on %[output:839ceb8d]
plot(powerDates, surplusEnergy) %[output:839ceb8d]
yline(0, 'color', "white") %[output:839ceb8d]
xlabel("date") %[output:839ceb8d]
ylabel("surplus energy (kWh)") %[output:839ceb8d]
title("Surplus/Deficit Energy for 2025"); %[output:839ceb8d]
hold off %[output:839ceb8d]

%%
%[text] ## Calculate Required Number of Turbines for each Case
maxPowerConsumed = max(powerConsumed_kW) %[output:40a89d38]
averagePowerProduced = mean(powerGenerated_kW) %[output:8214fc95]
requiredTurbines = maxPowerConsumed/averagePowerProduced %[output:11a0a1ee]
%%
